import React from "react";
import Row from "./Row";

const Inputs = () => {
  const [rowNum, setRowNum] = React.useState([<Row />]);

  function addRow() {
    setRowNum((prev) => [...prev, <Row />]);
  }

  return (
    <div className="input-div">
      <table>
        <tr>
          <th>Company</th>
          <th>Contact</th>
          <th>Country</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>
        <tr>
          <td>Centro comercial Moctezuma</td>
          <td>Francisco Chang</td>
          <td>Mexico</td>
        </tr>
      </table>
      <button className="addRow" onClick={addRow}>
        + Add row
      </button>
    </div>
  );
};

export default Inputs;
